import { DataGrid } from '@mui/x-data-grid';
import { FormControl } from '@mui/material';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField'
import axios from 'axios';
import * as React from 'react';
import {useEffect, useState, useRef} from 'react'

function App() {
  const pid = useRef()
  const [data, setData] = useState([])

  useEffect(()=>{
    getData()
  },[])

async function getData(){

  try {
    let response = await axios.post("http://localhost:5000/items/getItems", {pid:1})
    setData(response.data)
  }
  catch (err){
    console.log(err)
  }
}

console.log(data)

  const columns = [
    { field:"id", headerName:"ID", width: 20},
    { field: "wizProduct", headerName: "Animal Wiz Product", width:200},
    { field: "amazonProducts", headerName: "Amazon Products", width:200},
    { field: "petSmartProducts", headerName: "Pet Smart Products", width:200}
  ];

  const rows = [
    {id:1, wizProduct:"Shoes", amazonProducts: ["Shoe1","Shoe2"], petSmartProducts:["Shoe1", "Shoe2"]}
  ];

  return (
    <>
    <FormControl>
      <TextField id="pid" label="Filled" variant="filled" />
      <Button variant="contained" type="submit">Submit</Button>
    </FormControl>

    <div style={{height:500, margin:"auto"}}>
      <DataGrid
      rows={rows}
      columns={columns}
      pageSize={5}
      rowsPerPageOptions={[5]}
      checkboxSelection
      />

    </div>
    </>
  );
}

export default App;
